  false,\n\t\"url\": null,\n\t\"notes\": \"The sites listed herein contain potential
  beaches within Orange County that can receive nourishment sediment. These sites
  have been identified in previous efforts as either in need or have received nourishment
  in the past. These could potentially be used in conjunction with sediment sources
  to serve purposes of coastal regional sediment management.The shapefile was compiled
  by Everest International Consultants, Inc. and submitted to the Coastal Sediment
  Management Workgroup as part of the Orange County Coastal Regional Sediment Management
  Plan (2012).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
